import React from 'react';
import styles from './NavBar.module.css'

const NavBar = () => {
    console.log(styles);
    return (
        <nav className={styles.main_nav}>
                <img className={styles.logo_img}></img>
                <div className={styles.navbar_text}>
                
                </div>
        </nav>
    );
};

export default NavBar;
